import React from "react";
import mainLogo from'../../assets/github-logo.png'
import { Button } from 'antd';

const Signin: React.FC = () => {
  return (
    <div>
      <div>
        <form>
            <img  src={mainLogo}  alt="fireSpot"/>
            <Button type="primary">Button</Button>
        </form>
      </div>
    </div>
  );
};

export default Signin;
